import "./nav.css";
import SearchBar from '../search/SearchBar'

const prop = ["Home", "AboutAs", "Contact"]

export default function Nave(props){  
    return (<nav className="container_nav">
        <SearchBar onSearch={props.onSearch}/>
        <ul className="nav_Container">
         {
          prop.map(e => {
            return <li>{e}</li>;
          })
        }
        </ul>
        </nav>
    )
}
